const crypto = require("crypto");

// Sample JSON data
const jsonData = {
  type: "doc",
  content: [
    {
      type: "heading",
      attrs: {
        level: 1,
      },
      content: [
        {
          type: "text",
          marks: [
            {
              type: "textStyle",
              attrs: {
                color: "",
              },
            },
          ],
          text: "Track your",
        },
        {
          type: "hardBreak",
        },
        {
          type: "text",
          marks: [
            {
              type: "textStyle",
              attrs: {
                color: "rgb(23 34 190/var(--tw-text-opacity))",
              },
            },
          ],
          text: "writing progress effortlessly!",
        },
      ],
    },
    {
      type: "heading",
      attrs: {
        level: 3,
      },
      content: [
        {
          type: "text",
          marks: [
            {
              type: "underline",
            },
          ],
          text: "Automatically",
        },
        {
          type: "text",
          text: " sync your writing activity from your Notion Database and view your progress on a calendar.",
        },
      ],
    },
    {
      type: "image",
      attrs: {
        src: "data:image/jpeg;base64,",
        alt: null,
        title: null,
        width: 306.2,
        height: 306.2,
      },
    },
  ],
};
// Convert JSON data to string
const jsonString = JSON.stringify(jsonData);

// Encrypt the JSON string
const algorithm = "aes-256-cbc";
const key = crypto.randomBytes(32); // Generate a random key
const iv = crypto.randomBytes(16); // Generate a random IV
const cipher = crypto.createCipheriv(algorithm, key, iv);
let encryptedData = cipher.update(jsonString, "utf-8", "hex");
encryptedData += cipher.final("hex");

//
console.log(encryptedData);
// Store `key`, `iv`, and `encryptedData` in the database...
// Ensure you keep the `key` and `iv` securely, as they're needed for decryption.

// When retrieving from the database...

// Retrieve `key`, `iv`, and `encryptedData` from the database...
// Decrypt the encrypted data
const decipher = crypto.createDecipheriv(algorithm, Buffer.from(key), iv);
let decryptedData = decipher.update(encryptedData, "hex", "utf-8");
decryptedData += decipher.final("utf-8");

// Parse the decrypted JSON string
const decryptedJson = JSON.parse(decryptedData);
console.log("Decrypted JSON:", decryptedJson);

// Calculate the size of the encrypted data in bytes
const encryptedDataSizeInBytes = Buffer.byteLength(encryptedData, "hex");

// Calculate the size of the encrypted data in hexadecimal string representation
const encryptedDataSizeInHex = encryptedData.length;

console.log("Size of encrypted data in bytes:", encryptedDataSizeInBytes);
console.log("Size of encrypted data in hexadecimal:", encryptedDataSizeInHex);
